from fractions import Fraction
from functools import lru_cache
def a(n):
    @lru_cache()
    def f(m):
        if m == 1: return {Fraction(n, 1)}
        out = set()
        for j in range(1, m):
            for x in f(j):
                for y in f(m-j):
                    out.update([x + y, x - y, x * y])
                    if y: out.add(Fraction(x, y))
        return list(out)
    return sum(num >= 0 and num.denominator == 1 for num in f(n))
